            array(201009, 'São Paulo', 'Zuzarte Lopes', 'Vila Nivi', '02252-200', 'Rua')
            
        );        
        
        /**
         * Se a codificacao do banco de dados for utf8, tirar a função utf8_decode
         * ficando $sp->setCidade($value);
         */ 
        $batchSize = 20;
        $i = 1;
        foreach ($dados as $key => $value):            
            
            $sp = new Sp(); 
            $sp->setId($value[0]);
            $sp->setCidade($value[1]);
            $sp->setLogradouro($value[2]);
            $sp->setBairro($value[3]);
            $sp->setCep($value[4]);
            $sp->setTipoLogradouro($value[5]);
            
            $manager->persist($sp);
            if (($i % $batchSize) === 0) {
                $size = new Size();
                echo 'Flushing batch...' . "\n";
                echo 'Memory: ' . $size->getReadableSize(memory_get_usage()) . "\n";

                $manager->flush();
                $manager->clear();

                echo 'After batch...' . "\n";
                echo 'Memory: ' . $size->getReadableSize(memory_get_usage()) . "\n"; 
                unset($size);
            }            
            $i++;
            unset($sp);
            
        endforeach;        

        $manager->flush(); 
        $manager->clear();            
    }    
}